import React from "react";
import ReactDelayRender from "react-delay-render";
import FadeIn from "react-fade-in";

import "./AboutMe.css";

const AboutMe = () => {
  return (
    <div>
      <p className="about__paragraph">
        Hey, thanks for visiting! My name is Filip. I am a 30 year old Polish
        guy currently residing in Cork, Ireland. I am aspiring to become a Front
        End developer by learning different technologies along my way. This
        simple page is just a repository for all of my projects from the
        beginning of my coding journey.
      </p>
    </div>
  );
};

export default ReactDelayRender({ delay: 401 })(AboutMe);
